import xml.etree.ElementTree as ET

# Assume your XML content is loaded into a string
xml_string = """<blob-body blob-handle="{80-42-07-c4-5b-3d-48-8c-88-c2-2b-00-97-80-4a-93}">
<blob-content media-type="application/pdf" media-format-name="PDF" format="BASE64" number-of-pages="2">
<content></content>
<image-page-metadata page-index="1" height-in-inches="11.0" width-in-inches="8.5"/>
<image-page-metadata page-index="2" height-in-inches="11.0" width-in-inches="8.5"/>
</blob-content>
</blob-body>"""

# Parse the XML
root = ET.fromstring(xml_string)

# Extract the text from specific elements
extracted_text = ""
for elem in root.iter():
    if elem.tag == "content":
        extracted_text += elem.text + " "
     

print(extracted_text)

